import React from 'react';
import { Box, Text } from '@chakra-ui/react';

const Footer = props => {
  return (
    <Box marginX="auto" w="100%" {...props}>
      <Box textAlign="center" fontSize="xs" pt={2} fontWeight="300">
        <iframe
          src="https://open.spotify.com/follow/1/?uri=spotify:artist:6sFIWsNpZYqfjUpaCgueju&size=detail&theme=light"
          width="300"
          height="56"
          scrolling="no"
          frameborder="0"
          style="border:none; overflow:hidden;"
          allowtransparency="true"
        ></iframe>
        <Text>Designed & developed by Sumant Guha</Text>
        <Text>&copy; Crafted with ❤️ in Seattle</Text>
      </Box>
    </Box>
  );
};

export default Footer;
